import React from "react";
import "./Todo.css";
import {  useDispatch} from 'react-redux';
import {completeTask, removeTask} from './actions'

function Todo({ todo,location }) {

  const dispatch = useDispatch();

  return (
    <div className="card-header" style={{textDecoration : ((todo.completed)? "line-through" : "") , maxWidth:"60%" , alignItems : "center"}}>
      {todo.text}
      <button className="btn btn-success" style={{marginLeft : "5%"}} onClick={e => {
        e.preventDefault();
        dispatch(completeTask(location));
      }}> 
      Finish 
      </button>
      <button className="btn btn-danger" style={{marginleft : "5%"}} onClick={e => {
        e.preventDefault();
        dispatch(removeTask(location));
      }}> 
      x
      </button>
    </div>
  );
};

export default Todo;
